INSERT INTO `programs` VALUES (8,'asd','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque id quam lectus. Nunc commodo, orci id mattis dignissim, neque tortor sollicitudin turpis, nec blandit neque massa gravida felis. Sed consequat vel ipsum et cursus. Maecenas ac aliquet mauris. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Vivamus ut cursus quam. Curabitur ut tortor ac justo accumsan mollis. Donec hendrerit porta metus eget commodo. Nunc ac tellus lorem. Sed consequat faucibus scelerisque. In sed efficitur dolor, vel scelerisque arcu. Vestibulum a leo consequat, posuere mauris sit amet, vestibulum arcu.','2015-02-11 15:32:26','2015-02-11 15:32:26'),(11,'Leicester Urban Area (GA1)','Transformational Priority - The Leicester Launchpad has the potential to deliver significant housing and employment development on former industrial land within and in close proximity to the city centre. This will provide highly attractive development opportunities, particularly along the River Soar Waterside. Development has been prevented from coming forward at the rate expected in recent years owing to the need to assemble land and the cost of required infrastructure for access and servicing. Leicester Launchpad has the potential to deliver over 6,000 jobs.','2015-02-16 15:14:49','2015-02-16 15:14:49');
