INSERT INTO `projects` VALUES (12,'aas','',0,0,0,'2015-02-11 15:33:22','2015-02-11 15:33:22'),(14,'vbncv','',5,8,2,'2015-02-11 16:59:46','2015-02-11 16:59:47'),(15,'qqqw','',6,8,5,'2015-02-12 10:50:50','2015-02-12 10:50:51'),(16,'nvbn','',0,0,0,'2015-02-12 14:02:41','2015-02-12 14:02:42'),(17,'trrff','',0,0,0,'2015-02-13 11:19:02','2015-02-13 11:19:03'),(18,'qqqww','',0,0,0,'2015-02-16 12:41:39','2015-02-16 12:41:40'),(19,'Leicester Waterside Regeneration Area','An investment and infrastructure led programme to unlock development sites through investment in essential infrastructure and land assembly in the Waterside and Abbey Meadows parts of the Launchpad Area.',5,9,8,'2015-02-16 15:25:59','2015-02-16 15:26:01'),(20,'Leicester City Development Investment Fund','An investment fund is proposed by the City Council to unlock office, general employment, leisure and residential schemes, mainly in the city centre. The investment fund will create a variety of financial instruments including a revolving loan and equity fund and small grants.',8,6,2,'2015-02-16 15:35:34','2015-02-16 15:35:37'),(21,'Strategic Flood Risk Management','An important programme of works is planned by the Environment Agency, Leicester City Council and the Canals and Rivers Trust to reduce the risk of flooding in the northern part of Leicester. The programme will also create new cycling and walking routes on the River Soar and Grand Union Canal, linking the Leicester Launchpad area to the outer residential and commercial areas of Leicester.',3,6,4,'2015-02-16 15:45:12','2015-02-16 15:45:15'),(22,'Leicester College Skills and Innovation Village','Located adjacent to the city centre, Leicester College proposes to expand its facilities to provide new opportunities to develop local skills in priority sectors for the LLEP especially in engineering and sustainable construction. This expansion supports the development of the Leicester Launchpad.',6,3,6,'2015-02-16 15:48:55','2015-02-16 15:48:58');
